Standard geography level","vintage":null,"source":null,"units":null,"decimals":null},"HEALTHMEDHINC_CY":{"type":"number","alias":"2024 Median Household Income","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of Median Household Income in the geographic area. Median Household Income is the amount that divides household income (annual income for all household earners age 15+) into two equal groups in a geographic area; half of the population will have income higher than the median and half will have lower income. If the median falls in the upper income interval of $200,000+, it is represented by the value of $200,001. Esri uses the U.S. Census definition of income; reference <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>Esri Essential Vocabulary</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSPCI_CY":{"type":"number","alias":"2024 Per Capita Income","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of the Per Capita Income in the geographic area. Per Capita Income is calculated by dividing Aggregate Income by the Total Population for the area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"WEALTHMEDNW_CY":{"type":"number","alias":"2024 Median Net Worth","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of the Median Net Worth in the geographic area. Net Worth represents a measure of a household's wealth and ability to withstand financial hardship; it is total household assets, such as property and investments, less any secured or unsecured debt, such as credit cards. Median Net Worth divides household net worth into two equal groups in the geographic area; half of the households will have net worth higher than the median, and half lower. If the median is $2,000,000+, it is represented by a value of $2,000,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"EDUCATIONALATTAINMENTNOHS_CY":{"type":"number","alias":"2024 Pop Age 25+: < 9th Grade","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of Population Age 25+ who completed Less than a 9th grade education in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"EDUCATIONALATTAINMENTSOMEHS_CY":{"type":"number","alias":"2024 Pop Age 25+: High School/No Diploma","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of Population Age 25+ who completed some high school education (9-12th Grades in the United States) / No Diploma in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"EDUCATIONALATTAINMENTEDUCBASECY":{"type":"number","alias":"2024 Educational Attainment Base","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 base for Educational Attainment Age 25+. This base variable is used to calculate educational attainment percentages in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"EDUCATIONALATTAINMENTHSGRAD_CY_P":{"type":"number","alias":"2024 Pop Age 25+: High School Diploma: Percent","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of the Population Age 25+ who earned a High School Diploma in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"EDUCATIONALATTAINMENTSMCOLL_CY":{"type":"number","alias":"2024 Pop Age 25+: Some College/No Degree","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of Population Age 25+ who completed Some College without earning a degree in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"EDUCATIONALATTAINMENTASSCDEG_CY":{"type":"number","alias":"2024 Pop Age 25+: Associate's Degree","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of the Population Age 25+ who earned an Associate's Degree in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"EDUCATIONALATTAINMENTBACHDEG_CY":{"type":"number","alias":"2024 Pop Age 25+: Bachelor's Degree","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of the Population Age 25+ who earned a Bachelor's Degree in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"EDUCATIONALATTAINMENTGRADDEG_CY":{"type":"number","alias":"2024 Pop Age 25+: Grad/Professional Degree","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of the Population Age 25+ who earned a Graduate or Professional degree in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"BUSINESSESS01_BUS":{"type":"number","alias":"2024 Total Businesses (SIC)","vintage":"2024","source":"Esri-Data Axle","units":null,"decimals":null,"definition":"Esri 2024 estimate of the total number of businesses in SIC Code 01-99. Estimate based on business listings provided by Data Axle. See <a target='_blank' href='https://links.esri.com/demographics/business-summary'>Business Data</a> for more information."},"EMPLOYEESS01_EMP":{"type":"number","alias":"2024 Total Employees (SIC)","vintage":"2024","source":"Esri-Data Axle","units":null,"decimals":null,"definition":"Esri 2024 estimate of the total number of employees working for businesses in SIC Code 01-99. Estimate based on business listings provided by Data Axle. See <a target='_blank' href='https://links.esri.com/demographics/business-summary'>Business Data</a> for more information."},"ATRISKTOTPOP_CY":{"type":"number","alias":"2024 Total Population","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of the Total Population in the geographic area. Total Population includes population living in households, on active duty in the Armed Forces, and living in group quarters such as correctional facilities, skilled nursing facilities, juvenile facilities, college dorms, and military barracks. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"_5YEARINCREMENTSMEDAGE_CY":{"type":"number","alias":"2024 Median Age","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of the Median Age of the population in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"ATRISKTOTHH_CY":{"type":"number","alias":"2024 Total Households","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of the Total Households in the geographic area. A household includes all people who occupy one housing unit (such as a house or apartment) as their usual residence. A household may include related family members, unrelated people, a person living alone, or a group of unrelated people sharing a housing unit, such as partners or roommates. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"WEALTHMEDDI_CY":{"type":"number","alias":"2024 Median Disposable Income","vintage":"2024","source":"Esri","units":null,"decimals":null,"definition":"Esri 2024 Estimate of the Median Disposable Income in the geographic area. Disposable Income represents money after taxes and provides an estimate of a household's purchasing power. Four types of taxes are deducted: federal individual income taxes, state individual income taxes, FICA (Social Security) and federal retirement payroll taxes, and property taxes for owner-occupied housing. Median Disposable Income divides disposable income distribution into two equal groups; half the population has disposable income higher than the median, and half lower. If the median is $200,000+, it is represented by a value of $200,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSPOPGRWCYFY":{"type":"number","alias":"2024-2029 Growth Rate: Population","vintage":"2029","source":"Esri","units":null,"decimals":null,"definition":"Esri 2029 five-year forecast for Population: Compound Annual Growth Rate (CAGR). The Population CAGR is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total Population between the years 2024 and 2029. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocabulary/cagr'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSHHGRWCYFY":{"type":"number","alias":"2024-2029 Growth Rate: Households","vintage":"2029","source":"Esri","units":null,"decimals":null,"definition":"Esri 2029 five-year forecast for Households: Compound Annual Growth Rate (CAGR). The Households CAGR is an annualized measure that describes the direction (either positive or negative) and magnitude of change in total Households between the years 2024 and 2029. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocabulary/cagr'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSFAMGRWCYFY":{"type":"number","alias":"2024-2029 Growth Rate: Family HHs","vintage":"2029","source":"Esri","units":null,"decimals":null,"definition":"Esri 2029 five-year forecast for Family Households: Compound Annual Growth Rate (CAGR). The Family Household CAGR is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total number of family households between the years 2024 and 2029. A family consists of two or more people residing together that are related by birth, marriage, or adoption. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocabulary/cagr'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"PSYCHOGRAPHICSSHOPPINGMP28108A_B_P":{"type":"number","alias":"2024 Spend 7+ Hrs Commuting to/from Work/Wk: Percent","vintage":"2024","source":"Esri-MRI-Simmons","units":null,"decimals":null,"definition":"Esri 2024 estimate of the expected number of adults and Market Potential Index (MPI) for <em>2024 Spend 7+ Hours Commuting to/from Work Per Week</em> in the geographic area. Esri’s Market Potential data provides information about the likely demand for specific products or services, as well as expected consumer attitudes and behaviors, in an area. The MPI compares local consumer demand, attitudes, and behaviors to U.S. levels. The MPI value for the U.S. is 100. If, for example, the MPI value for a geographic area is 120 this implies that consumer demand in the geographic area is likely to be 20% more than the U.S. average. Sources: Esri and MRI-Simmons. See <a target='_blank' href='https://links.esri.com/demographics/market-potential'>Market Potential data</a> for more information."},"COMMUTEACSDRALONE_P":{"type":"number","alias":"2022 Workers 16+: Drove Alone (ACS 5-Yr): Percent","vintage":"2018-2022","source":"ACS","units":null,"decimals":null,"definition":"ACS five-year estimate of the number of Workers Age 16+ who primarily Drove Alone to Work in the geographic area. Includes responders who typically drove alone to work and responders who were driven to work by someone else (such as a family member) who then returned home or to a non-work destination. Responders who used a different transportation method on different days were asked to specify their primary method; responders who used multiple methods in one trip were asked to specify the one used for the longest distance. Estimate and Margin of Error (MOE) from the U.S. Census American Community Survey (ACS) rolling sample 60-month survey; Esri Reliability measure designates the usability of the estimate. See <a tar e lower income. If the median falls in the upper income interval of $200,000+, it is represented by the value of $200,001. Esri uses the U.S. Census definition of income; reference <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>Esri Essential Vocabulary</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSPCI_CY":{"id":"PCI_CY","fullName":"KeyUSFacts.PCI_CY","alias":"2024 Per Capita Income","fieldName":"KEYUSFACTSPCI_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSPCI_CY","type":"esriFieldTypeDouble","vintage":"2024","source":"Esri","definition":"Esri 2024 Estimate of the Per Capita Income in the geographic area. Per Capita Income is calculated by dividing Aggregate Income by the Total Population for the area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.WEALTHMEDNW_CY":{"id":"MEDNW_CY","fullName":"Wealth.MEDNW_CY","alias":"2024 Median Net Worth","fieldName":"WEALTHMEDNW_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.WEALTHMEDNW_CY","type":"esriFieldTypeDouble","vintage":"2024","source":"Esri","definition":"Esri 2024 Estimate of the Median Net Worth in the geographic area. Net Worth represents a measure of a household's wealth and ability to withstand financial hardship; it is total household assets, such as property and investments, less any secured or unsecured debt, such as credit cards. Median Net Worth divides household net worth into two equal groups in the geographic area; half of the households will have net worth higher than the median, and half lower. If the median is $2,000,000+, it is represented by a value o Calculator.BUSINESSESS01_BUS","type":"esriFieldTypeDouble","vintage":"2024","source":"Esri-Data Axle","definition":"Esri 2024 estimate of the total number of businesses in SIC Code 01-99. Estimate based on business listings provided by Data Axle. See <a target='_blank' href='https://links.esri.com/demographics/business-summary'>Business Data</a> for more information."},"dataCollectionsCalculator.EMPLOYEESS01_EMP":{"id":"S01_EMP","fullName":"employees.S01_EMP","alias":"2024 Total Employees (SIC)","fieldName":"EMPLOYEESS01_EMP","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.EMPLOYEESS01_EMP","type":"esriFieldTypeDouble","vintage":"2024","source":"Esri-Data Axle","definition":"Esri 2024 estimate of the total number of employees working for businesses in SIC Code 01-99. Estimate based on business listings provided by Data Axle. See <a target='_blank' href='https://links.esri.com/demographics/business-summary'>Business Data</a> for more information."},"dataCollectionsCalculator.ATRISKTOTPOP_CY":{"id":"TOTPOP_CY","fullName":"AtRisk.TOTPOP_CY","alias":"2024 Total Population","fieldName":"ATRISKTOTPOP_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.ATRISKTOTPOP_CY","type":"esriFieldTypeDouble","vintage":"2024","source":"Esri","definition":"Esri 2024 Estimate of the Total Population in the geographic area. Total Population includes population living in households, on active duty in the Armed Forces, and living in group quarters such as correctional facilities, skilled nursing facilities, juvenile facilities, college dorms, and military barracks. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator._5YEARINCREMENTSMEDAGE_CY":{"id":"MEDAGE_CY","fullName":"5yearincrements.MEDAGE_CY","alias":"2024 Median Age","fieldName":"_5YEARINCREMENTSMEDAGE_CY","precision":1,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator._5YEARINCREMENTSMEDAGE_CY","type":"esriFieldTypeDouble","vintage":"2024","source":"Esri","definition":"Esri 2024 Estimate of the Median Age of the population in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.ATRISKTOTHH_CY":{"id":"TOTHH_CY","fullName":"AtRisk.TOTHH_CY","alias":"2024 Total Households","fieldName":"ATRISKTOTHH_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.ATRISKTOTHH_CY","type":"esriFieldTypeDouble","vintage":"2024","source":"Esri","definition":"Esri 2024 Estimate of the Total Households in the geographic area. A household includes all people who occupy one housing unit (such as a house or apartment) as their usual residence. A household may include related family members, unrelated people, a person living alone, or a group of unrelated people sharing a housing unit, such as partners or roommates. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.WEALTHMEDDI_CY":{"id":"MEDDI_CY","fullName":"Wealth.MEDDI_CY","alias":"2024 Median Disposable Income","fieldName":"WEALTHMEDDI_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.WEALTHMEDDI_CY","type":"esriFieldTypeDouble","vintage":"2024","source":"Esri","definition":"Esri 2024 Estimate of the Median Disposable Income in the geographic area. Disposable Income represents money after taxes and provides an estimate of a household's purchasing power. Four types of taxes are deducted: federal individual income taxes, state individual income taxes, FICA (Social Security) and federal retirement payroll taxes, and property taxes for owner-occupied housing. Median Disposable Income divides disposable income distribution into two equal groups; half the population has disposable income higher than the median, and half lower. If the median is $200,000+, it is represented by a value of $200,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSPOPGRWCYFY":{"id":"POPGRWCYFY","fullName":"KeyUSFacts.POPGRWCYFY","alias":"2024-2029 Growth Rate: Population","fieldName":"KEYUSFACTSPOPGRWCYFY","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSPOPGRWCYFY","type":"esriFieldTypeDouble","vintage":"2029","source":"Esri","definition":"Esri 2029 five-year forecast for Population: Compound Annual Growth Rate (CAGR). The Population CAGR is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total Population between the years 2024 and 2029. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocabulary/cagr'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSHHGRWCYFY":{"id":"HHGRWCYFY","fullName":"KeyUSFacts.HHGRWCYFY","alias":"2024-2029 Growth Rate: Households","fieldName":"KEYUSFACTSHHGRWCYFY","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSHHGRWCYFY","type":"esriFieldTypeDouble","vintage":"2029","source":"Esri","definition":"Esri 2029 five-year forecast for Households: Compound Annual Growth Rate (CAGR). The Households CAGR is an annualized measure that describes the direction (either positive or negative) and magnitude of change in total Households between the years 2024 and 2029. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocabulary/cagr'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSFAMGRWCYFY":{"id":"FAMGRWCYFY","fullName":"KeyUSFacts.FAMGRWCYFY","alias":"2024-2029 Growth Rate: Family HHs","fieldName":"KEYUSFACTSFAMGRWCYFY","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSFAMGRWCYFY","type":"esriFieldTypeDouble","vintage":"2029","source":"Esri","definition":"Esri 2029 five-year forecast for Family Households: Compound Annual Growth Rate (CAGR). The Family Household CAGR is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total number of family households between the years 2024 and 2029. A family consists of two or more people residing together that are related by birth, marriage, or adoption. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocabulary/cagr'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.PSYCHOGRAPHICSSHOPPINGMP28108A_B_P":{"id":"MP28108A_B_P","fullName":"PsychographicsShopping.MP28108A_B_P","alias":"2024 Spend 7+ Hrs Commuting to/from Work/Wk: Percent","fieldName":"PSYCHOGRAPHICSSHOPPINGMP28108A_B_P",
